import React from 'react';
import Post from './Post';
import Suggestion from './Suggestion';
import ProfileSection from '.';

function Main() {
    return (
        <div>
            <div
                className="main"
                style={{ display: 'flex', justifyContent: 'space-between' }}
            >
                <ProfileSection/>
                <Post />
                <Suggestion />
            </div>
        </div>
    );
}

export default Main;
